import React from "react";

const Index = (props) => {
  return (
    <div>
      <h1>Bem vindo!</h1>
      <div>{props.currentData}</div>
    </div>
  );
};

export async function getServerSideProps(context) {
  return {
    props: {
      currentData: new Date().toString(),
    },
  };
}
export default Index;
